import React from 'react';
import './featured-fun.css';
import blackwoman from './blackwoman.jpg';

export default function FeaturedFun(image, h1, p, lists) {
  return (
    <div>
      <div>
        <img src={blackwoman} alt="yes" />
      </div>
    </div>
  );
}
